import React from "react";
import "./Cardcss.css";
const Card = (medicine) => {
    const {medicineName ,medcineURL}=medicine
  return (
    <div className="card">
      {/* <img src="image.jpg" alt="Card Image" className="card-image" /> */}
      <div className="card-content">
        <h2 className="card-title">${medicine.name}</h2>
        <p className="card-description">
          <a href={medicine.url} target="_blank" rel="noopener noreferrer">
            {medicine.name}
          </a>
        </p>
        <button className="card-button">Learn More</button>
      </div>
    </div>
  );
};

export default Card;
